import {Link , useNavigate} from 'react-router-dom'
import { useSelector } from 'react-redux';
import { setToken , setMenu ,setNotificationCenter } from '../store/slices/slice';
import { useDispatch } from 'react-redux';
import { useEffect } from 'react';


function Navbar(){
    const {token,menu,notificationCenter}=useSelector(state=>({
        token:state.global.token,
        menu:state.global.menu,
        notificationCenter:state.global.notificationCenter
    }))
    const navigate=useNavigate()
    const dispatch=useDispatch()

    return(
       <div className='fixed w-screen inset-0 h-16.4'>
            <div className="flex justify-between p-4 bg-green-600 rounded-md ml-1 mr-1">
                <img src='/icos/menu-hamburger.svg' className='symbol cursor-pointer' onClick={()=>{token?dispatch(setMenu(!menu)):navigate('/login')}}/>
                <div className='flex items-center gap-1 sm:gap-5'>
                    <img src="/icos/notification.svg"  alt="Alerts logo" className="symbol cursor-pointer" onClick={()=>dispatch(setNotificationCenter(!notificationCenter))}/>
                    {token
                    ?
                        <button className="border border-black border-2 bg-white rounded-md  sm:p-1 text-xxs sm:text-base  w-10 sm:w-20 h-5 sm:h-auto" onClick={()=>{localStorage.removeItem('token');dispatch(setToken(null));dispatch(setMenu(false))}}>
                            Logout
                        </button> 
                    :
                        <Link to="/login" >
                            <button className="border border-black border-2 bg-white rounded-md  sm:p-1 text-xxs sm:text-base  w-10 sm:w-20 h-5 sm:h-auto">Login</button>
                        </Link>
                    }
                </div>
            </div>
       </div>
    )
}
export default Navbar
